(28, 47, 'developerhabib1230@gmail.com', '[{\"id\":1,\"name\":\"iphone 14\",\"description\":\"Short description\",\"category\":\"Phone\",\"brand\":\"apple\",\"selectedImg\":{\"image\":\"https://m.media-amazon.com/images/I/417tEj3iJ8L._AC_.jpg\",\"color\":\"Gray\",\"colorCode\":\"#808080\"},\"quantity\":10,\"price\":\"2999.00\"},{\"id\":6,\"name\":\"new product edited again\",\"description\":\"Yo Yo nice!\",\"category\":\"awesome\",\"brand\":\"my_brand\",\"selectedImg\":{\"image\":\"http://127.0.0.1:8000/storage/images/p-4.JPG\",\"color\":\"p-4\",\"colorCode\":\"#ff2245\"},\"quantity\":4,\"price\":\"399.00\"},{\"id\":5,\"name\":\"Smart Watch(Answer/Make Call), 1.85\\\" Smartwatch for Men Women IP68 Waterproof, 100+ Sport Modes, Fitness Activity Tracker, Heart Rate Sleep Monitor, Pedometer, Smart Watches for Android iOS, 2023\",\"description\":\"Bluetooth Call and Message Reminder: The smart watch is equipped with HD speaker, after connecting to your phone via Bluetooth, you can directly use the smartwatches to answer or make calls, read messages, store contacts, view call history. The smartwatch can set up more message notifications in \\\"GloryFit\\\" APP. You will never miss any calls and messages during meetings, workout and riding.\",\"category\":\"Watch\",\"brand\":\"Nerunsa\",\"selectedImg\":{\"image\":\"https://m.media-amazon.com/images/I/71zbWSRMaYL.__AC_SX300_SY300_QL70_FMwebp_.jpg\",\"color\":\"Silver\",\"colorCode\":\"#C0C0C0\"},\"quantity\":6,\"price\":\"50.00\"},{\"id\":3,\"name\":\"Apple iPhone 13, 64GB\",\"description\":\"The product is refurbished, fully functional, and in excellent condition. Backed by the 90-day E~Shop Renewed Guarantee.\\n- This pre-owned product has been professionally inspected, tested and cleaned by Amazon qualified vendors. It is not certified by Apple.\\n- This product is in \\\"Excellent condition\\\". The screen and body show no signs of cosmetic damage visible from 12 inches away.\\n- This product will have a battery that exceeds 80% capacity relative to new.\\n- Accessories may not be original, but will be compatible and fully functional. Product may come in generic box.\\n- Product will come with a SIM removal tool, a charger and a charging cable. Headphone and SIM card are not included.\\n- This product is eligible for a replacement or refund within 90-day of receipt if it does not work as expected.\\n- Refurbished phones are not guaranteed to be waterproof.\",\"category\":\"Phone\",\"brand\":\"Apple\",\"selectedImg\":{\"image\":\"https://m.media-amazon.com/images/I/713Om9vCHUL._AC_SX679_.jpg\",\"color\":\"Blue\",\"colorCode\":\"#0000FF\"},\"quantity\":5,\"price\":\"40.00\"},{\"id\":2,\"name\":\"Logitech MX Keys Advanced Wireless Illuminated Keyboard, Tactile Responsive Typing, Backlighting, Bluetooth, USB-C, Apple macOS, Microsoft Windows, Linux, iOS, Android, Metal Build (Black)\",\"description\":\"PERFECT STROKE KEYS - Spherically-dished keys match the shape of your fingertips, offering satisfying feedback with every tap\\r\\nCOMFORT AND STABILITY - Type with confidence on a keyboard crafted for comfort, stability, and precision\",\"category\":\"Accesories\",\"brand\":\"logitech\",\"selectedImg\":{\"image\":\"https://m.media-amazon.com/images/I/71gOLg2-kqL.__AC_SX300_SY300_QL70_FMwebp_.jpg\",\"color\":\"Black\",\"colorCode\":\"#000000\"},\"quantity\":3,\"price\":\"102.99\"}]');
